import sys

class Solution:
    def updateMatrix(self, mat: list[list[int]]) -> list[list[int]]:
        if mat == None or len(mat) == 0 or len(mat[0]) == 0:
            return mat

        row, col = len(mat), len(mat[0])
        dist = [[0 for i in range(len(mat[0]))] for j in range(len(mat))]
        queue = []

        for i in range(len(mat)):
            for j in range(len(mat[0])):
                seen = set()
                if mat[i][j] == 0:
                    dist[i][j] = 0
                    queue.append((i,j))
                else:
                    dist[i][j] = sys.maxsize

        row_dir = [0,0,1,-1]
        col_dir = [1,-1,0,0]

        while queue:
            curr = queue.pop()
            for i in range(4):
                new_r = curr[0] + row_dir[i]
                new_c = curr[1] + col_dir[i]
                if 0 <= new_r < row and 0 <= new_c < col:
                    if dist[new_r][new_c] > dist[curr[0]][curr[1]] + 1:
                        dist[new_r][new_c] = dist[curr[0]][curr[1]] + 1
                        queue.append((new_r, new_c))

        return dist

mat = [[0,0,0],[0,1,0],[0,0,0]]
mat = [[0,0,0],[0,1,0],[1,1,1]]
mat = [[0],[0],[0],[0],[0]]
